import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

class SideBar extends React.Component {
  render() {
    return <div className="sidebar">
        <div>
          <nav href="#navbar" className="js-colorlib-nav-toggle colorlib-nav-toggle" data-toggle="collapse" data-target="#navbar" aria-expanded="false" aria-controls="navbar"><i /></nav>
          <aside id="colorlib-aside" className="border js-fullheight">
            <div className="text-center">
              <div className="author-img" /* style={{backgroundImage: 'url(images/about.jpg)'}} */ />
              <h1 id="colorlib-logo"><a href="index.html">Patrick Wamsley</a></h1>
              <span className="email"><i className="icon-mail"></i> Dhruv.barochiya34788@gmail.com</span>
            </div>
            <nav id="colorlib-main-menu" role="navigation" className="navbar">
              <div id="navbar" className="collapse">
                <ul>
                  <li className="active"><a href="#home" data-nav-section="home">Introduction</a></li>
                  <li><a href="#about" data-nav-section="about">About</a></li>
                  <li><a href="#timeline" data-nav-section="timeline">Timeline</a></li>
                </ul>
              </div>
            </nav>
            <nav id="colorlib-main-menu">
              <ul>
                <li><a href="https://github.com" target="_blank" rel="noopener noreferrer"><i className="icon-github"></i></a></li>
              </ul>
            </nav>
          </aside>
        </div>
    </div>
  }
}

class HomeScreen extends React.Component {
  render() {
    return <div className="home_screen">



    </div>
  }
}



ReactDOM.render(
  <HomeScreen />, 
  document.getElementById('root')
);
